import React from "react";
import './AboutUs.css';
const MainEvent = () => {
    return (
        <marquee behavior="" className="marquee-container" direction="ltr">
        <div className="links">
          <a href="/converse">Converse</a>
          <a href="/converse">Scholarship</a>
          <a href="/showathletics">Athletics</a>
        </div>
      </marquee>
    );
}
export default MainEvent;
